goog.setTestOnly("goog.testing.events.OnlineHandler");goog.provide("goog.testing.events.OnlineHandler");goog.require("goog.events.EventTarget");goog.require("goog.net.NetworkStatusMonitor");goog.testing.events.OnlineHandler=function(initialState){goog.testing.events.OnlineHandler.base(this,"constructor");this.online_=initialState};goog.inherits(goog.testing.events.OnlineHandler,goog.events.EventTarget);goog.testing.events.OnlineHandler.prototype.isOnline=function(){return this.online_};goog.testing.events.OnlineHandler.prototype.setOnline=function(newOnlineState){if(newOnlineState!=this.online_){this.online_=newOnlineState;this.dispatchEvent(newOnlineState?goog.net.NetworkStatusMonitor.EventType.ONLINE:goog.net.NetworkStatusMonitor.EventType.OFFLINE)}};